import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import DietInsufficient from './DietInsufficient';
import DietNormal from './DietNormal';

function App() {
  const [formData, setFormData] = useState({
    gender: '',
    age: '',
    height: '',
    weight: '',
    family_history_with_overweight: '',
    FAVC: '',
    FCVC: '',
    NCP: '',
    CAEC: '',
    SMOKE: '',
    CH2O: '',
    FAF: '',
    TUE: '',
    CALC: '',
    MTRANS: '',
  });

  const [fact, setFact] = useState('');
  const [prediction, setPrediction] = useState(null);
  const [url, setUrl] = useState('');

  const facts = [
    "It takes the brain 20 minutes to sense that a person is full.",
    "Women with post-traumatic stress disorder are more likely to be overweight or obese.",
    "One in three U.S. children and teens are overweight or obese.",
    "Childhood obesity affects self-esteem, which can affect employment and higher education later in life.",
    "Obesity prevalence was highest among U.S. adults with a high school diploma or some college education."
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      const randomFact = facts[Math.floor(Math.random() * facts.length)];
      setFact(randomFact);
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }

      const result = await response.json();
      console.log('Result:', result);

      setPrediction(result.prediction);
      setUrl(result.url);

    } catch (error) {
      console.error('Error during fetch:', error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Obesity Risk Prediction</h1>
      </header>
      <form onSubmit={handleSubmit}>
        <div className="form-container">
          <div className="form-column">
            {/* Form Fields */}
            {Object.keys(formData).map((key) => (
              <div key={key}>
                <label>{key.replace(/_/g, ' ')}:</label>
                <input
                  type={key === 'age' || key === 'height' || key === 'weight' || key === 'CH2O' || key === 'FAF' || key === 'TUE' ? 'number' : 'text'}
                  name={key}
                  value={formData[key]}
                  onChange={handleChange}
                  required
                />
              </div>
            ))}
          </div>
        </div>
        <button type="submit">Predict</button>
      </form>
      {prediction !== null && (
        <div>
          <h2>Prediction</h2>
          <p>Prediction: {prediction}</p>
          <p>
            <a href={url} target="_blank" rel="noopener noreferrer">View Dietary Recommendations</a>
          </p>
        </div>
      )}
      <div>
        <h2>Did You Know?</h2>
        <p>{fact}</p>
      </div>
    </div>
  );
}

const AppWrapper = () => (
  <Router>
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/diet-insufficient" element={<DietInsufficient />} />
      <Route path="/diet-normal" element={<DietNormal />} />
    </Routes>
  </Router>
);

export default AppWrapper;
